import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  function handleClick(e){
    e.preventDefault();
    console.log('CLICKED');
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <button onClick={handleClick}
          className="Login"
        >
          LOGIN
        </button>
      </header>
    </div>
  );
}

export default App;
